import React from 'react';
//import './App.css';

const Header = () => {
	return (
		<header className="header">
			<div className= "logo">
				<h1>Chien Huang</h1>
			</div>
			<nav>
				<ul className='nav-links'>
					<li>< a href="#about">About me</a></li>
					<li><a href="#reflection">WIL Reflection</a></li>
				</ul>
			</nav>
		</header>		
	);	
};

export default Header;
